import "./App.css";
import Axios from "axios";
require("dotenv").config();

function App() {
  const url = `https://api.edamam.com/search?q=chicken&app_id=${process.env.REACT_APP_ID}&app_key=${process.env.REACT_APP_KEY}&from=0&to=3&calories=591-722&health=alcohol-free`;
  const getData = async () => {
    const result = await Axios.get(url);
    console.log(result);
  };
  return (
    <div className="App">
      {console.log(process.env.REACT_APP_ID)}
      <h1 onClick={getData}>Food Searching App</h1>
    </div>
  );
}

export default App;
